def tree_parse(res):
    if isinstance(res,requests.models.Response) and res.status_code == 200:
        enconding = requests.utils.get_encodings_from_content(res.text)
        html_doc = res.content.decode(enconding[0])
        tree = etree.HTML(html_doc)
        return tree
    else:
        print('res数据类型错误或请求失败，无法解析。。。')


