def get_player_id(player_key,player_en):
    spx_dev_session = MysqlSvr.get('spider_zl')
    player_data = {
        'key':player_key,
        'name_en':player_en,
    }
    _, row = BleaguejpBasketballPlayer.upsert(
                        spx_dev_session,
                        'key',
                        player_data
                    )
    return row.id,row.shirt_number

